// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{ background: '#007bff', padding: '1rem', color: 'white' }}>
      <Link to="/" style={{ color: 'white', marginRight: '1rem' }}>Home</Link>
      <Link to="/admin" style={{ color: 'white', marginRight: '1rem' }}>Admin</Link>
      <Link to="/doctor" style={{ color: 'white', marginRight: '1rem' }}>Doctor</Link>
      <Link to="/patient" style={{ color: 'white' }}>Patient</Link>
    </nav>
  );
};

export default Navbar;
